%% Doing the same as above for total (abs) effect size, mean effect size, and peak
sensoryNames = {'ankle'; 'knee'; 'hip'; 'headA'; 'headV'; 'COPx'; 'COPy';};
speeds = {'sp1'; 'sp2'; 'sp3'; 'sp4'; 'sp5'; 'sp6'; 'sp7'; 'sp8';}; % Speeds in order as above 0, -0.02, -0.5, -0.1, -0.15, -0.2, -0.3, -0.4
leg = {'L';'R'}; % Leg

for iSub = 1:length(subjects)
    strSubject = subjects{iSub};    
    subjectID = ['YAP' strSubject];
    for iLeg = 1:size(leg,1) % Each leg
        for iSpeeds = 1:size(speeds,1) % The 8 different perturbation speeds as described in speeds
            for iSense = 1:length(sensoryNames)
                temp = length(subStruc.(subjectID).data.(leg{iLeg}).(speeds{iSpeeds}).perceived);
                for iPerts = 1:temp
                    subStruc.(subjectID).ES2.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2pre.total(iPerts) = sum(abs(subStruc.(subjectID).ES.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2pre(21:61,iPerts)));
                    subStruc.(subjectID).ES2.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2pre.avg(iPerts) = mean(abs(subStruc.(subjectID).ES.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2pre(21:61,iPerts)));
                    subStruc.(subjectID).ES2.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2pre.max(iPerts) = max(abs(subStruc.(subjectID).ES.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2pre(21:61,iPerts)));
                    subStruc.(subjectID).ES2.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).post2pre.total(iPerts) = sum(abs(subStruc.(subjectID).ES.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).post2pre(21:61,iPerts)));
                    subStruc.(subjectID).ES2.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).post2pre.avg(iPerts) = mean(abs(subStruc.(subjectID).ES.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).post2pre(21:61,iPerts)));
                    subStruc.(subjectID).ES2.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).post2pre.max(iPerts) = max(abs(subStruc.(subjectID).ES.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).post2pre(21:61,iPerts)));
                    subStruc.(subjectID).ES2.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2post.total(iPerts) = sum(abs(subStruc.(subjectID).ES.(leg{iLeg}).(speeds{iSpeeds}).(sensoryNames{iSense}).onset2post(21:61,iPerts)));
